__NUXT_JSONP__("/svet/mesto/raby-bay", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v){return {data:[{place:[{id:j,id_state:k,name:l,population:327,area:.13,altitude:30,slug:m,information_chatgpt:a,coordinates:[{latitude:-29.0333,longitude:167.95}],biggest:"yes",type_place:c,id_image_cover:a,id_image_hero:a,affiliate:[{name:n,value:o}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:d,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2023-12-27T17:06:48.496338+00:00",name_original:a}],imagePlace:[],placeState:[{tld:".nf",name:"Norfolk",area:36,population:2166,slug:p,id_continent:f,information_chatgpt:"\u003Cp\u003ENorfolk je jeden ze států v Austrálii, nacházející se východně od Sydney. Má rozlohu 170.000 kilometrů čtverečních a zahrnuje nejen pevninskou část, ale také mnoho ostrovů v Tichomoří.\u003C\u002Fp\u003E\n\u003Cp\u003EStát Norfolk je známý především svou krásnou přírodou a jedinečnou flórou a faunou. Na ostrově se nachází největší les s druhem stromů Araucaria heterophylla na světě, který byl prohlášen za světové dědictví UNESCO. Dále tu najdete také národní parky a chráněné oblasti, kde se ukrývají ohrožené druhy jako například kakadu norfolkský nebo vydra mořská.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho je Norfolk populární také mezi turisty, kteří sem přijíždějí zejména kvůli plážím a možnostem vodních sportů. Oblíbené aktivity zahrnují potápění, šnorchlování, surfování a rybaření.\u003C\u002Fp\u003E\n\u003Cp\u003EHistoricky byl Norfolk také místem, kam byli posíláni vězni z Austrálie a Nového Zélandu. Dnes je toto období připomínáno v muzeu v Kingstonu, které je hlavním městem státu. Můžete tu také navštívit kostel Sv. Barnaby, který byl postaven britskými vězni v 19. století a je jednou z nejvýznamnějších historických památek na ostrově.\u003C\u002Fp\u003E\n\u003Cp\u003ENorfolk je tedy skvělým místem pro ty, kteří hledají kombinaci přírody, historie a relaxace na pláži. Pokud se sem chystáte, nezapomeňte si přibalit plavky, potápěčskou výbavu a dobrou knihu k odpočinku na pláži!\u003C\u002Fp\u003E",currency_code:"AUD",currency_name:"australský dolar",money_prices:[{name:"Taxi (cena za km)",value:q,date_update:b},{name:"Hlavní jídlo",value:20,date_update:b},{name:"Chleba",value:g,date_update:b},{name:"Mléko",value:4.5,date_update:b},{name:"Voda (500ml)",value:q,date_update:b},{name:"Espresso",value:4,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:g,date_update:b},{name:"Pivo",value:8,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Big Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:g,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:b},{name:"Policie",value:h,date_update:b},{name:"Hasiči",value:h,date_update:b},{name:"Zdravotnická záchranná služba",value:h,date_update:b}],phone_prefix:"+672",coordinates:[{latitude:"-29.040835",longitude:"167.954712"}],people_religion:[{name:"Anglikánské",value:"43%"},{name:"Římskokatolické",value:"17%"},{name:"Unitářské",value:"6%"},{name:"Jiné náboženství",value:"7%"},{name:"Neuvedeno",value:"27%"}],people_nationality:[{name:"Norfolčané",value:"49%"},{name:"Britové",value:r},{name:"Pitcairnci",value:"11%"},{name:"Ostatní",value:r}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Norfolkue není možné použít občanský průkaz. Je nutné mít platný cestovní pas.",date_update:e},{name:"Cestovní pas",value:"Pro vstup do Norfolkue je nutné mít platný cestovní pas.",date_update:e},{name:"Vízum",value:"Pro občany Evropské unie není nutné žádat o vízum před cestou do Norfolkue, pokud plánují pobyt kratší než 90 dní. V ostatních případech je nutné vízum žádat předem u příslušného zastupitelského úřadu.",date_update:e},{name:"Očkování",value:"Pro vstup do Norfolkue není povinné žádné očkování. Nicméně je doporučeno být očkován proti běžným nemocem jako jsou například spalničky, zarděnky, neštovice a chřipka.",date_update:e},{name:"Cestovní pojištění",value:"Pro vstup do Norfolkue není nutné mít cestovní pojištění, ale doporučuje se mít zdravotní pojištění, které by pokrylo případné lékařské náklady v zahraničí.",date_update:e},{name:"Bezpečnostní situace",value:"Norfolk je relativně bezpečnou zemí, kde se vyskytuje minimum kriminality. Nicméně se doporučuje být obezřetný a dodržovat základní bezpečnostní opatření, zejména v místech s větší koncentrací turistů.",date_update:e},{name:"Další informace",value:"Při vstupu do Norfolkue musí být cestovatelé připraveni na to, že na ostrově je vysoká cena za zboží a služby. Dále se doporučuje mít dostatečné množství hotovosti, protože ne všechny obchody a služby přijímají platební karty. V zemi se používají britské zásuvky s napětím 240 V.",date_update:e}],type_place:s,id_image_cover:i,id_image_hero:i,id_city_main:t,affiliate:[{name:n,value:o}],mpz:"NF",alerts:a,zoom:[{google:u,booking:u}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:k,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2023-12-27T17:07:31.480426+00:00",name_original:a}],imageState:[{id:i,name:p,source:"\u002Fworld\u002Fstates\u002F",type:s,author:"pixabay.com",created_at:"2023-05-03T20:14:00.749527+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"australie-a-oceanie",name:"Austrálie a Oceánie",area:8560000,population:42000000,population_density:4.9,number_states:14,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E je kontinent, které se nachází na jižní polokouli. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E je největší zemí v Oceánii, zatímco Oceánie zahrnuje mnoho ostrovů v Tichomoří, včetně \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nové Guiney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsamoa\"\u003ESamoa\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETongy\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie\u003C\u002Fb\u003E je známá svými exotickými zvířaty, jako jsou \u003Cb\u003Eklokani\u003C\u002Fb\u003E, \u003Cb\u003Ekoaly\u003C\u002Fb\u003E a \u003Cb\u003Eemuové\u003C\u002Fb\u003E. Je také domovem mnoha překrásných pláží, kde se lze slunit, surfovat a potápět. Nejznámějšími městy jsou \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E je známé svým \u003Cb\u003Eoperním domem\u003C\u002Fb\u003E a \u003Cb\u003EHarbour Bridge\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E je považováno za kulturní centrum a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E je ideální pro milovníky adrenalinových sportů, jako je rafting a skákání padákem.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENový Zéland\u003C\u002Fa\u003E\u003C\u002Fb\u003E, má jedinečnou přírodu a kulturu. Nachází se zde mnoho přírodních památek, včetně hor, jezer a národních parků. Země je také domovem mnoha původních \u003Cb\u003EMaorů\u003C\u002Fb\u003E a jejich kultury. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fauckland\"\u003EAuckland\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fwellington\"\u003EWellington\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší města na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, zatímco \u003Cb\u003EQueenstown\u003C\u002Fb\u003E je oblíbená destinace pro turisty hledající adrenalinové sporty a krásnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E je jednou z nejvíce odlehlých a exotických destinací na světě. Země je plná původních kmenů a mnoha z nich si stále zachovávají tradiční zvyky a rituály. Turisté sem jezdí kvůli krásným plážím a překrásné přírodě. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fport-moresby\"\u003EPort Moresby\u003C\u002Fa\u003E\u003C\u002Fb\u003E je hlavním městem země a láká návštěvníky svými muzei a historickými památkami.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E je také známá svými neuvěřitelnými korálovými útesy a podmořským životem. Korálové útesy \u003Cb\u003EVelký bariérový útes\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší na světě a lákají milovníky potápění z celého světa. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETonga\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou další oblíbené destinace pro potápěče a snorkelisty.\u003C\u002Fp\u003E\u003Cp\u003EMezi další známé ostrovy v \u003Cb\u003EOceánii\u003C\u002Fb\u003E patří \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E, které jsou součástí USA. \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E jsou známé svými surferskými plážemi, sopkami a krásnou přírodou. \u003Cb\u003ETahiti\u003C\u002Fb\u003E, největší ostrov \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, láká návštěvníky svými luxusními resorty, bílými plážemi a modrými lagunami. \u003Cb\u003EBora Bora\u003C\u002Fb\u003E, jeden z ostrovů \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je oblíbený mezi páry hledající romantickou dovolenou.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E má také bohatou historii a kulturu původních obyvatel. Původní obyvatelé \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EMaorové\u003C\u002Fb\u003E, mají svou vlastní kulturu a jazyk. V \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou původní obyvatelé \u003Cb\u003EAboridžinci\u003C\u002Fb\u003E, kteří mají svůj vlastní jazyk, tradice a umění. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho různých původních kmenů, z nichž každý má své vlastní tradice a jazyk.\u003C\u002Fp\u003E\n\u003Cp\u003ECo se týče cestování do \u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E, musí cestovatelé získat víza pro vstup do země, pokud je to požadováno. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho mezinárodních letišť, zatímco v \u003Cb\u003EOceánii\u003C\u002Fb\u003E jsou letiště menší a mohou být omezenější. Mnoho ostrovů v \u003Cb\u003ETichomoří\u003C\u002Fb\u003E má také přísné pravidla pro dovoz zahraničních rostlin a zvířat, aby se chránila původní ekologie.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a na mnoha ostrovech v \u003Cb\u003EOceánii\u003C\u002Fb\u003E se můžete potkat s tropickým klimatem s teplými lety a mírnými zimami. V některých částech \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E však může být klima velmi suché a horké, zatímco na jiných místech může být velmi vlhké a deštivé.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E jsou také oblíbenými destinacemi pro adrenalinové sporty, jako je potápění, surfování, skákání padákem, rafting a další. Mnoho turistů také navštěvuje \u003Cb\u003EAustrálii a Oceánii\u003C\u002Fb\u003E kvůli sportovním akcím, jako jsou tenisové turnaje v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo ragbyové zápasy na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003Cb\u003E.\u003C\u002Fp\u003E",coordinates:[{latitude:-25.274398,longitude:133.775136}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:v,booking:v}],information_author:a,seo_tags:a,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00",name_original:a}],placesCities:[{id:1600,id_image_cover:a,importance:d,slug:"alligator-creek",type_place:c,name:"Alligator Creek"},{id:1602,id_image_cover:a,importance:d,slug:"anson-bay",type_place:c,name:"Anson Bay"},{id:1603,id_image_cover:a,importance:d,slug:"bumboras",type_place:c,name:"Bumboras"},{id:1599,id_image_cover:a,importance:d,slug:"burnt-pine",type_place:c,name:"Burnt Pine"},{id:1601,id_image_cover:a,importance:d,slug:"cascade",type_place:c,name:"Cascade"},{id:t,id_image_cover:a,importance:d,slug:"kingston--stat-norfolk",type_place:c,name:"Kingston"},{id:1604,id_image_cover:a,importance:d,slug:"longridge",type_place:c,name:"Longridge"},{id:1605,id_image_cover:a,importance:d,slug:"middlegate",type_place:c,name:"Middlegate"},{id:1606,id_image_cover:a,importance:d,slug:"phillip-island",type_place:c,name:"Phillip Island"},{id:j,id_image_cover:a,importance:d,slug:m,type_place:c,name:l}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarEventComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023","city","biggest","09-2021",6,3.5,"000 nebo 911",330,1607,163,"Raby Bay","raby-bay","booking",true,"norfolk",2.5,"20%","state",1598,12,3)));